import React from "react";
import { useState } from "react";

function Box({ getColor, setColor, id, select }) {
  const [getColor2, setColor2] = useState();
  function changecolor() {
    setColor2("grey");
    setColor("white");
  }

  return (
    <div
      id={id}
      onClick={changecolor}
      style={{ background: getColor2 }}
      className="box a"
    ></div>
  );
}

export default Box;
